import React from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';

const mapStyles = {
    width: '100%',
    height: '100%'
};

const GoogleMaps = () => {

    return (
        <Map
            google={this.props.google}
            zoom={14}
            style={mapStyles}
            initialCenter={{
                lat: -1.2884,
                lng: 36.8233
            }}
        />
    );
}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyCvFrGxeLjEHl7V3Vyox1M6Aq4vxL-xkTU'
})(GoogleMaps);
